import React from "react"
import "./publicmessage.scss"

const publicmessage = () => {
	return (
		<span className="public-message">
			Dear viewer 🙌🏽, this site
			<br /> is currently under construction ⛑ Feel free to reach out to me on
			one of the following outlets on your left 😁
		</span>
	)
}

export default publicmessage
